selector_to_html = {"a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/droidcam-seleccion-skype.jpg\"><img alt=\"Selecci\u00f3n de DroidCam como c\u00e1mara en Skype.\" src=\"../../../../_images/droidcam-seleccion-skype.jpg\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Selecci\u00f3n de DroidCam como c\u00e1mara en las aplicaciones.</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#referencias\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Referencias<a class=\"headerlink\" href=\"#referencias\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#instalacion-en-linux\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Instalaci\u00f3n en Linux<a class=\"headerlink\" href=\"#instalacion-en-linux\" title=\"Link to this heading\">#</a></h3><p>El procedimiento de instalaci\u00f3n puede seguirse en la p\u00e1gina web de\nDroidCam [<a class=\"reference internal\" href=\"#linux\">linux</a>] pero lo lustrar\u00e9 para el caso de Linux Mint\n(aplicable para Debian y derivados). El aspecto dependiente de la\ndistribuci\u00f3n es la instalaci\u00f3n de las 3 dependencias requeridas (GCC, Make\ny Linux Headers).</p>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/droidcam-vs-integrada.png\"><img alt=\"Comparaci\u00f3n de c\u00e1mara DroidCam y c\u00e1mara integrada.\" src=\"../../../../_images/droidcam-vs-integrada.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Comparaci\u00f3n incorporando la vista de DroidCam (izquierda) y la c\u00e1mara integrada de mi equipo (derecha) en OBS.</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#usar-la-camara-de-tu-celular-como-webcam\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Usar la c\u00e1mara de tu celular como webcam<a class=\"headerlink\" href=\"#usar-la-camara-de-tu-celular-como-webcam\" title=\"Link to this heading\">#</a></h1><p>Con la nueva normalidad que vivimos alrededor de la virtualidad, el uso de\nvideollamadas se ha incrementado y muchas c\u00e1maras incorporadas en los\nequipos no poseen buenas caracter\u00edsticas (o son ausentes). Adicional, el\nsoporte de opciones como usar el celular, una buena alternativa para no\ncomprar una c\u00e1mara web, es amplio en Windows pero no en Linux.</p><p>As\u00ed que, por ese motivo hoy les compartir\u00e9 como usar la c\u00e1mara del celular\n(Android o iOS) como c\u00e1mara web en Linux.</p>", "a[href=\"#instalacion-en-android\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Instalaci\u00f3n en Android<a class=\"headerlink\" href=\"#instalacion-en-android\" title=\"Link to this heading\">#</a></h3><p>Para instalar en Android, buscamos DroidCam en Google Play [<a class=\"reference internal\" href=\"#android\">android</a>].\nEncontrar\u00e1n dos versiones, una gratuita y una paga. Podemos usar la\ngratuita para la funcionalidad requerida, siendo \u00fanica limitaci\u00f3n la\nresoluci\u00f3n m\u00e1xima a la que transmite.</p><p>Una vez instalada, procedemos a abrir y seguir los siguientes pasos:</p>", "a[href=\"#droidcam\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">DroidCam<a class=\"headerlink\" href=\"#droidcam\" title=\"Link to this heading\">#</a></h2><p>Sin hacer muchos rodeos y comparaciones, en este asunto ser\u00e9 muy pr\u00e1ctico.\nLa primera aplicaci\u00f3n que me cumpli\u00f3 con las caracter\u00edsticas y que\nfuncion\u00f3 adecuadamente, es DroidCam [<a class=\"reference internal\" href=\"#id1\">droidcam</a>]. Esta utilidad nos permite\nusar la c\u00e1mara del celular para reemplazar los incorporados del equipo, y\nse puede hacer comunicaci\u00f3n tanto por wifi como por el cable USB\n(instalando ADB).</p>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/droidcam-linux-gui.png\"><img alt=\"Cliente GUI de DroidCam en Linux.\" src=\"../../../../_images/droidcam-linux-gui.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Cliente GUI de DroidCam en Linux. Aqu\u00ed ingresamos IP y puerto.</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/droidcam-activo-ip-puerto.jpg\"><img alt=\"DroidCam activo (informaci\u00f3n de IP y puerto).\" src=\"../../../../_images/droidcam-activo-ip-puerto.jpg\" style=\"width: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">DroidCam activo (informaci\u00f3n de IP y puerto).</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ejecutar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ejecutar<a class=\"headerlink\" href=\"#ejecutar\" title=\"Link to this heading\">#</a></h2><p>Finalmente, para hacer uso de DroidCam en Linux, debemos ejecutar en la\nconsola <code class=\"code docutils literal notranslate\"><span class=\"pre\">droidcam</span></code> y esto abrir\u00e1 un GUI para ingresar la IP y el\npuerto que usaremos.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
